document.addEventListener("DOMContentLoaded",function(){let popups=document.querySelectorAll("[popup]");if(popups){popups.forEach(function(a){let url="";if(a.getAttribute("href")){url=a.getAttribute("href")}else{if(a.getAttribute("popup")){url=a.getAttribute("popup")}}let name="";if(a.getAttribute("title")){name=a.getAttribute("title")}else{if(a.getAttribute("data-title")){name=a.getAttribute("data-title")}else{if(a.getAttribute("data-name")){name=a.getAttribute("data-name")}}}if(url){a.addEventListener("click",function(b){b.preventDefault();return openPopup(url,name)})}})}});let popupOpen=false,popup=null;function openPopup(b,a){if(popupOpen){popup.close()}let winSize={width:0,height:0};if(typeof(window.innerWidth)=="number"){winSize.width=window.innerWidth;winSize.height=window.innerHeight}else{if(document.documentElement&&(document.documentElement.clientWidth||document.documentElement.clientHeight)){winSize.width=document.documentElement.clientWidth;winSize.height=document.documentElement.clientHeight}else{if(document.body&&(document.body.clientWidth||document.body.clientHeight)){winSize.width=document.body.clientWidth;winSize.height=document.body.clientHeight}}}winSize.width=(winSize.width.toFixed()*1);winSize.height=(winSize.height.toFixed()*1);let size={width:((winSize.width/100*90).toFixed()*1),height:((winSize.height/100*90).toFixed()*1)};let center={width:(((winSize.width-size.width)/2).toFixed()*1),height:(((winSize.height-size.height)/2).toFixed()*1)};popup=window.open(b,a,"width="+size.width+",height="+size.height+",left="+center.width+",top="+center.height);popupOpen=true;return popup};